import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button';


const Buttons = () => {


  return (
  <ButtonGroup color="primary" aria-label="outlined primary button group">
  <Button>Red</Button>
  <Button>Green</Button>
  <Button>Blue</Button>
</ButtonGroup>
)

}

export default  Buttons
